clearyourcache:
'''ხვილაფა:''' ჩუალაშ უკული შილებე ქეგიახვილათ ბრაუზერიშ ქეშიშ გოწიმინდუას თირუეფიშ ოძირაფალო. 
* '''Firefox / Safari:''' ქეგუნჭირით ''Shift'' ''Reload''-ის გეწკანტაფაშის, ვარ-და ქეგუნჭირით ''Ctrl-F5'', ვარ-და ''Ctrl-R'' (''⌘-R'' Mac-ის); 
* '''Google Chrome:''' ქეგუნჭირით ''Ctrl-Shift-R'' (''⌘-Shift-R'' Mac-ის);
* '''IE:''' ქეგუნჭირით ''Ctrl'' ''Refresh''-ის გეწკანტაფაშის, ვარ-და ქეგუნჭირით ''Ctrl-F5'';
* '''Opera''' გოწიმინდეთ ქეში ''Tools→Preferences''-შე.

uploadtext:
ათე ფორმაშ გჷმორინაფაშის თქვა შეგალებენა სერვერშა ფაილეფიშ ეხარგუა.

კინოხ ეხარგელი ფაილეფიშ ოძიარაფალო გეგნორთით  [[Special:FileList|ეხარგელ ფაილეფიშ ერკებულშა]]. ეხარგელი ფაილეფი თაშნეშე დინმიჭარუაფჷ [[Special:Log/upload|ეხარგუეფიშ დო კჷნე ახალშო ეხარგილეფიშ ჟურნალს]], დო ლასირი ფაილეფი დინმიჭარუაფჷ [[Special:Log/delete|ლასირეფიშ ჟურნალს]].

ფაილიშ სტატიაშა დინაჭარალო გჷმირინეთ:
* '''<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.jpg]]</nowiki></code>''' ფაილიშ ედომუშამი ვერსიაშ ინახუნაფალო;
* '''<code><nowiki>[[</nowiki>{{ns:file}}<nowiki>:File.png|200px|thumb|left|ეჭარუა]]</nowiki></code>''' 200 პიქსელშახ დაკუნტარებული ვერსიაშ ინახუნაფალო ეჭარუაშ მეწურაფაშ შილებუათ;
* '''<code><nowiki>[[</nowiki>{{ns:media}}<nowiki>:File.ogg]]</nowiki></code>''' რსხილიშ ინახუნაფალო, გჷმოხანტუალაშ ძირაფაშ უმუშო.

